  \"2016-05-07T00:09:10.854366\",\n\t\"name\": \"annual-energy-outlook\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Annual Energy Outlook presents longterm
  annual projections of energy supply, demand, and prices focused on the U.S. through
  2040, based on results from EIAa?Ts National Energy Modeling System (NEMS). NEMS
  enables EIA to make projections under alternative, internally-consistent sets of
  assumptions, the results of which are presented as cases. The analysis in AEO2014
  focuses on five primary cases: a Reference case,rnLow and High Economic Growth cases,
  and Low and High Oil Price cases. Users of the EIA API are required to obtain an
  API Key via this registration form: http://www.eia.gov/beta/api/register.cfm\",\n\t\"license_title\":
